    static associate(models) {
      Access.belongsTo(models.Accounts, {
        foreignKey: 'user_id',
        onDelete: 'CASCADE'
      });
      Access.belongsTo(models.Devices, {
        foreignKey: 'device_id',
        onDelete: 'CASCADE'
      });
    }
  };
  Access.init({
    // user_id: {
    //   allowNull: false,
