import express from 'express';
import { body, validationResult } from 'express-validator';     // Check email/password valid input
import bodyParser from 'body-parser';                           // Json
import path from 'path';                                        // Path => express.static

import { sequelize } from '../models'

const jsonParser = bodyParser.json();
const urlencodedParser = bodyParser.urlencoded({ extended: false });

const app = express();                                          // Express()

export const expressRoute = () => {
    app.use(express.static(path.join(__dirname, './public')));
}

export const expressListen = ( port ) => {
    const server = app.listen(port,  host, async function () {
        const host = server.address().address;
        const port = server.address().port;
        try {
            await sequelize.authenticate({alter: true});
                console.log('Connection has been established successfully.');
            console.log("Server start at: http://%s:%s", host, port)
        }
        catch (err) {
            console.log(err);
        }
    });
}

