import {
    Accounts,
    Varification,
    Teams,
    Teamparticular,
    Channels,
    Channelparticular,
    Messages,
    sequelize
} from '../models';

// Query ACCOUNTs

    // Query PK
    export async function QueryAccountPK(username) {
        let apk = await Accounts.findOne({
            where: {
                username
            }
        });
        return apk.dataValues.id
    }
    // Query username:
    export async function QueryUsername(id) {
        let usn = await Accounts.findOne({
            where: {
                id
            }
        });
        return usn.dataValues.username;
    }
    // Query VARIFICATIONs


